import React from 'react';
import { Component } from 'react';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      clubs: [
        {
          id: 1,
          name: "Barcelona",
          point: 69,
        },
        {
          id: 2,
          name: "Real Madrid",
          point: 56,
        },
        {
          id: 3,
          name: "Atlético Madrid",
          point: 66,
        },
      ],
    };
  }

